import React from "react";

const TodoModal = () => {
  return (
    <TodoInsert>
      <TodoInsertWrapper>
        <TodoInsertTitle
          placeholder="할 일"
          value={title}
          onChange={onChangeTitle}
        />
        <TodoInsertBody
          placeholder="상세 내용"
          value={content}
          onChange={onChangeContent}
        />
        <TodoInsertButton onClick={onSubmit}>제출하기</TodoInsertButton>
      </TodoInsertWrapper>
    </TodoInsert>
  );
};

export default TodoModal;
